INSERT INTO `berita_detail` (`berita_detail_id`, `berita_id`, `berita_detail_judul`, `berita_detail_slug`, `berita_detail_gambar`, `berita_detail_isi`, `berita_detail_dibaca`, `berita_detail_editor`, `berita_detail_rep`, `berita_detail_foto`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 3, 'Hadiri Peringatan Maulid Nabi Bersama Permasa Bupati: Pendidikan Agama Prioritas Program Kerja KBS', 'hadiri-peringatan-maulid-nabi-bersama-permasa-bupati-pendidikan-agama-prioritas-program-kerja-kbs', '1690848582_557c0cf7c00c34cbf164.jpg', '<p style=\"text-align: justify;\">MANDAU, PROKOPIM &ndash; Tidak sebatas dalam visi misi pemerintahannya, Bupati Bengkalis Kasmarni, dihadapan santri Pondok Pesantren Al-Huda Mandau Duri dengan tegas menyampaikan program kerja pemerintah selalu memperhatikan aspek pendidikan berbasis keagamaan.</p>\r\n<p style=\"text-align: justify;\">Dari delapan program unggulan Pemerintah Daerah, kami telah menyediakan program beasiswa pendidikan khusus serta berprestasi, dengan kegiatan pemberian beasiswa khusus tahfidz al-qur&rsquo;an, termasuk juga bantuan honorarium bagi guru pendidikan agama.</p>', 3, 'Nurhadi', 'Beby Candra', 'Khaidir', '2023-06-17 03:41:09', '2023-07-31 19:09:42', NULL),
(2, 3, 'Buka MTQ Desa Damai Wabup Ajak Ketuk Pintu Berkah Dari Langit dan Bumi', 'buka-mtq-desa-damai-wabup-ajak-ketuk-pintu-berkah-dari-langit-dan-bumi', '1690848453_205001dd2147ff6dc8a3.jpg', '<p style=\"text-align: justify;\"><strong>DAMAI, PROKOPIM -</strong> Wakil Bupati (Wabup) Dr H Bagus Santoso mengajak masyarakat membuka pintu berkah dari langit dan bumi melalui keimanan dan ketaqwaan penduduk negeri diantaranya dengan gemar membaca dan mengamalkan Al-Quran.</p>\r\n<p style=\"text-align: justify;\">Hal tersebut disampaikan Wabup Bagus Santoso dengan membacakan Firman Allah dalam surat Al-A&rsquo;raf ayat 96 saat membuka acara MTQ desa Damai Kecamatan Bengkalis, sabtu malam, (3/6/2023), bertempat di halaman Kantor Desa Damai, Kecamatan Bengkalis.</p>', 0, 'Widodo', 'Unggul', 'Unggul', '2023-06-17 04:26:32', '2023-07-31 19:08:30', NULL),
(3, 1, 'Bupati Bengkalis Minta Karyawan RSUD Berikan Pelayanan Yang Baik dan Prima', 'bupati-bengkalis-minta-karyawan-rsud-berikan-pelayanan-yang-baik-dan-prima', '1690848921_2ab1cd9d812c23030978.jpg', '<p style=\"text-align: justify;\">MANDAU, HUMAS - Usai menghadiri Hari Amal Bhakti ke-74, Bupati Bengkalis melakukan kunjungan di RSUD Mandau, Senin (6/1/2020).</p>\r\n<p style=\"text-align: justify;\">Peninjauan tersebut didampingi oleh Anggota DPRD Bengkalis, Al Azmi, Sanusi, Syafroni Untung, dan Nanang Haryanto, Asisten Perekonomian dan Pembangunan Sekretariat Daerah Bengkalis H. Heri Indra Putra, Plt. Direktur RSUD Mandau Sri Sadono, Ketua TP PKK Kabupaten Bengkalis Kasmarni, serta sejumlah Kepala Perangkat Daerah di lingkungan Pemerintah Kabupaten Bengkalis.</p>\r\n<p style=\"text-align: justify;\">Sesampainya Kepala Daerah Bengkalis di RSUD, tampak seluruh masyarakat sangat antusias menyambut kehadiran orang Nomor Satu di Kabupaten Bengkalis itu.</p>', 0, 'Widodo', 'Unggul', 'Unggul', '2023-07-31 19:15:21', '2023-07-31 19:15:21', NULL),
(4, 1, 'DPPPA Kabupaten Bengkalis Taja Seminar Pemutakhiran Data dan Profit Gender', 'dpppa-kabupaten-bengkalis-taja-seminar-pemutakhiran-data-dan-profit-gender', '1690848969_b00766edd6cb39353d72.jpg', '<p style=\"text-align: justify;\">BENGKALIS, HUMAS - Pemerintah Kabupaten Bengkalis, melalui Dinas Pemberdayaan Perempuan dan Perlindungan Anak, melaksanakan seminar akhir dari pemutakhiran data dan profit Gender Tahun 2019, di Gedung GOW Bengkalis, Jumat (29/11/2019).&nbsp;</p>\r\n<p style=\"text-align: justify;\">Dalam pemaparan seminar yang disampaikan oleh Zulkifli selaku Narasumber I bahwa tujuan dari seminar profit gender di Kabupaten Bengkalis yaitu sebagai perbedaan fungsi dan peran sosial antara laki-laki dan perempuan yang dikonstruksikan oleh masyarakat.&nbsp;</p>', 0, 'Widodo', 'Unggul', 'Unggul', '2023-07-31 19:16:09', '2023-07-31 19:16:09', NULL);
