(2, 1, 'Bupati Bengkalis Kasmarni Menerima Penghargaan Terbaik I Kategori Kabupaten Terbaik Pembangunan', 'bupati-bengkalis-kasmarni-menerima-penghargaan-terbaik-i-kategori-kabupaten-terbaik-pembangunan', '1690852430_98334dcaa93a70248894.jpg', '<p style=\"text-align: justify;\">Bupati Bengkalis Kasmarni Menerima Penghargaan Terbaik I Kategori Kabupaten Terbaik Pembangunan Daerah Tingkat Provinsi Riau</p>\r\n<p>&nbsp;</p>\r\n<p>Artikel lengkap tentang \" <strong>Bupati Bengkalis Kasmarni Menerima Penghargaan Terbaik I Kategori Kabupaten Terbaik Pembangunan Daerah Tingkat Provinsi Riau</strong> \" Silahkan buka tautan berikut ini -&gt; <a href=\"https://prokopim.bengkaliskab.go.id/web/detailberita/14459/bupati-kasmarni-terima-penghargaan-kategori-kabupaten-pembangunan-daerah-terbaik-i-tahun-2023-dari-gubernur-riau\" target=\"_BLANK\"> https://prokopim.bengkaliskab.go.id/web/detailberita/14459/bupati-kasmarni-terima-penghargaan-kategori-kabupaten-pembangunan-daerah-terbaik-i-tahun-2023-dari-gubernur-riau </a></p>', '2023-06-20 01:39:00', '2023-07-31 20:13:50', NULL),
(3, 1, 'Bupati Bengkalis Terima Penghargaan Tiga Sertifikat Sekaligus Dari Badan Pengawasan Keuangan', 'bupati-bengkalis-terima-penghargaan-tiga-sertifikat-sekaligus-dari-badan-pengawasan-keuangan', '1690852294_569a6ede1a19f676e13b.jpg', '<p style=\"text-align: justify;\">Bupati Bengkalis Terima Penghargaan Tiga Sertifikat Sekaligus Dari Badan Pengawasan Keuangan dan Pembangunan Pusat Melalui BPKP Perwakilan Provinsi Riau</p>\r\n<p>&nbsp;</p>\r\n<p>Artikel lengkap tentang \" <strong>Bupati Bengkalis Terima Penghargaan Tiga Sertifikat Sekaligus Dari Badan Pengawasan Keuangan dan Pembangunan Pusat Melalui BPKP Perwakilan Provinsi Riau</strong> \" Silahkan buka tautan berikut ini -&gt; <a href=\"https://prokopim.bengkaliskab.go.id/web/detailberita/14462/pemkab-bengkalis-raih-3-sertifikat-level-3-dari-bpkp-perwakilan-provinsi-riau,-bupati-kasmarni-senang\" target=\"_BLANK\"> https://prokopim.bengkaliskab.go.id/web/detailberita/14462/pemkab-bengkalis-raih-3-sertifikat-level-3-dari-bpkp-perwakilan-provinsi-riau,-bupati-kasmarni-senang </a></p>', '2023-06-20 01:40:32', '2023-07-31 20:11:34', NULL),
