INSERT INTO `profil` (`profil_id`, `profil_judul`, `profil_slug`, `profil_isi`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Sekilas Prokopim', 'sekilas-prokopim', '<p>Humas pemerintah adalah aktifitas lembaga yang melakukan fungsi managemen dalam bidang komunikasi dan informasi kepada publik pemangku kepentingan dan atau sebaliknya. peran Humas pemerintah sebagai&nbsp; komunikator, fasilitator dan desiminator.</p>\r\n<ol>\r\n<li>Humas komunikator yaitu, Humas pemerintah berperan membuka akses saluran dan komunikasi dua arah, antara instansi&nbsp; pemerintah dan publiknya, baik secara langsung mau pun tidak langsung.</li>\r\n<li>Peran Humas sebagai fasilitator, Humas pemerintah berperan menerap perkembangan situasi dan aspirasi publik untuk di jadikan masukan bagi pimpinan instansi pemerintah dalam pengambilan putusan.</li>\r\n<li>Desiminator Humas&nbsp; pemerintah berperan dalam pelayanan informasi terhadap internal organisasi dan publiknya, baik langsung mau pun tidak langsung, mengenai kebijakan dan kegiatan masing-masing instansi pemerintah.</li>\r\n</ol>\r\n<p><br />Humas adalah kegiatan sebagai komunikasi yang berfungsi sebagai jembatan untuk membangun suasana yang sangat kondusif dalam rangka Win-win Solution Stake Holder, organisasi baik internal maupun eksternal dalam rangka membangun citra dari institusi pemerintah.<br /><br />Oleh karena itu, praktek Humas yang paling ideal komunikasi aktif, menginformasikan berbagai kebijakan pemerintah kepada masyarakat, hal itu bertujuan untuk membentuk citra positif daerah tersebut dimata publiknya.<br /><br />Pentingnya peran Humas di suatu instansi dan lembaga pemerintah, dalam masyarakat modern, yakni dalam melakukan kegiatan-kegiatan dan operasinya di berbagai tempat dan berbagai bidang.<br /><br />&nbsp;Humas sebagai juru bicara pemerintah, melakukan hubungan timbal balik antara pemerintah daerah dengan masyarakat umum, dan organisasi kemasyarakatan, untuk memperjelas suatu kegiatan pemerintah daerah dalam melakukan hubungan intern dengan satuan dan peliputan kegiatan-kegiatan yang dilaksanakan oleh pemerintah maupun masyarakat.<br /><br />&nbsp;Serta melaksanakan koordinasi atau kerja sama dengan organisasi kewartawanan&nbsp; (Moore, 2004 ). maksud dan tujuan melaksanakan peran Humas pemerintah adalah untuk membentuk citra&nbsp; positif tentang pemerintah di masyarakat dibutuhkanlah terobosan baru dari sebuah praktek ke Humasan, ciri dan kekhasan informasi yang diharapkan menjadi kekuatan dan karakter dari kontek ke Humasan kekinian.<br /><br />Oleh karena&nbsp; itu, Humas mampu menjadi mainstream ditengah dominasi berita yang dimiliki segelintir media dan cenderung elitis, Adapun yang dimaksud terobosan yaitu, harus mampu melampoi semata-mata persoalan kelembagaan, kedepan nanti semestinya sudah bisa menjawab tentang tantangan ke Humasan. Dengan mengedapankan Subtansi dimana posisi otonomi daerah sesungguhnya memiliki peran yang lebih terbuka dan secara proses lebih demokratis. Dengan memberikan peran yang lebih kuat pada proses informasi publik dan sekaligus pilihan pada tren teknologi, diharapkan terjadi terobosan sehingga mampu menjadi produser informasi. Memperkuat citra dimata publik, sekaligus menjadi model desain partisipasi ditingkat gagasan untuk pembangunan daerah.<br /><br />Kemudian tren teknologi saat ini, dimana masing-masing pihak bisa menjadi produser sekaligus bisa menjadi konsumer, harus menjadi model pengembangan kedepan, misalnya : kehadiran media cetak dan media elektronik. Sebuah konsep menginformasikan yang didasarkan bahwa pelayanan publik haruslah responsif terhadap berbagai kepentingan dan nilai-nilai publik. Tugas pemerintah adalah melakukan negosiasi dan mengelaborasi berbagai kepentingan warga atau masyarakat. Dengan demikian karakter dan nilai yang tergantung didalam pelayanan publik harus berisi preferensi nilai-nilai yang ada pada masyarakat, karena masyarakat bersifat dinamis maka karakter pelayanan publik juga&nbsp; selalu berubah mengikuti perkembangan dimata masyarakat, untuk menuju kesana pemerintah seharusnya mampu, mau serta melakukan kajian-kajian kebutuhan dimasyarakat, sekaligus kemudian dikembangkan menjadi suatu rencana kerja peningkatan kefasilitas. ( Sumber dari RB.Budi surjono )<br /><br />Tugas praktek ke Humasan yaitu membuat dan mengoperasikan berita didaerahnya antara lain,terkait kemajuan pembangunan dan fenomena sosial lain, yang memperkuat strategi daerah yang bisa tergerak dengan sesuai tren teknologi yang ada serta&nbsp; aspirasi informasi dari masyarakat.</p>', '2023-06-17 06:24:46', '2023-07-31 19:02:41', NULL),
(2, 'Visi dan Misi', 'visi-dan-misi', '<h2 style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 1.75em; line-height: 1.5; font-family: Lato, sans-serif; vertical-align: baseline; text-transform: uppercase; color: #000000; text-align: center;\">VISI DAN MISI KABUPATEN BENGKALIS</h2>\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.35em; line-height: 1.5; font-family: inherit; vertical-align: baseline; text-transform: uppercase; color: #000000;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">VISI:</span></h3>\r\n<p><span style=\"color: #111111; font-family: Lato, sans-serif; font-size: 17.3333px;\">\" TERWUJUDNYA KABUPATEN BENGKALIS YANG BERWARWAH, MAJU DAN SEJAHTERA \"</span></p>\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.35em; line-height: 1.5; font-family: inherit; vertical-align: baseline; text-transform: uppercase; color: #000000;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: #e5474b;\">MISI:</span></h3>\r\n<ol>\r\n<li>Mewujudkan Pengelolaan Potensi Keuangan Daerah, Sumber Daya Alam dan Sumber Daya Manusia yang Efektif dalam Memajukan Perekonomian.</li>\r\n<li>Mewujudkan Reformasi Birokrasi Serta Penguatan Nilai-nilai Agama dan Budaya melayu Menuju Tata Kelola Pemerintahan yang Baik dan Masyarakat yang Berkarakter.</li>\r\n<li>Mewujudkan Penyediaan Infrastruktur yang Berkualitas dan Mengembangkan Potensi Wilayah Perbatasan untuk Kesejahteraan Rakyat.</li>\r\n</ol>\r\n<h2 class=\"elementor-heading-title elementor-size-large\"><span style=\"color: #339966;\">Program Unggulan</span></h2>\r\n<p>Untuk memperkuat capaian dari agenda prioritas daerah, ditetapkan 8 (delapan) program unggulan yang akan memberikan pengaruh besar terhadap masyarakat dan daerah, yakni:</p>\r\n<ol style=\"list-style-type: lower-roman;\">\r\n<li>Bantuan Keuangan Satu Milyar Satu Kecamatan, Satu Desa Dan Satu Kelurahan</li>\r\n<li>Pemberdayaan Perempuan Berdaya Keluarga Sejahtera</li>\r\n<li>Beasiswa Pendidikan Khusus Dan Berprestasi</li>\r\n<li>Akses Jaminan Sosial Dan Kesehatan Total Bagi Masyarakat</li>\r\n<li>Optimalisasi Pelayanan Transportasi Antar Pulau</li>\r\n<li>Menjadikan Wisma Daerah Sebagai Rumah Aspirasi</li>\r\n<li>Pelayanan Sistem Kependudukan Berbasis Mobile</li>\r\n<li>Stimulus Ekonomi Dan Peningkatan Lapangan Pekerjaan</li>\r\n</ol>', '2023-06-17 06:27:59', '2023-07-31 19:03:23', NULL);
INSERT INTO `sekretariat` (`sekretariat_id`, `sekretariat_judul`, `sekretariat_slug`, `sekretariat_isi`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Bagian Hukum', 'bagian-hukum', '<p><strong>BAGIAN HUKUM</strong></p>\r\n<p>Mempunyai tugas menyiapkan koordinasi, menyusun kebijakan, kegiatan dan program kerja, merumuskan serta melaksanakan dalam perumusan peraturan perundang-undangan, memberikan bantuan hukum, mempublikasikan dan mendokumentasikan produk hukum serta penyuluhan hukum.</p>\r\n<p><strong>Kabag Hukum M. Fendro Arrasyid, SH</strong></p>', '2023-06-17 05:41:00', '2023-07-31 19:04:20', NULL),
(2, 'Bagian Adm Kerjasama Daerah', 'bagian-adm-kerjasama-daerah', '<p><strong>BAGIAN ADMINISTRASI KERJASAMA DAERAH</strong></p>\r\n<p>Mempunyai tugas menyiapkan koordinasi, menyusun kebijakan, kegiatan dan program kerja, merumuskan serta melaksanakan administrasi kerjasama daerah.</p>\r\n<p><strong>KEPALA BAGIAN KERJA SAMA </strong><span style=\"color: #222222;\"><strong>DIAN RACHMADHANY, S.STP, M.Si</strong></span></p>', '2023-06-17 05:57:12', '2023-07-31 19:04:45', NULL);
